57b0c427-590a-444e-a722-04e5e266b64a.debug:
{
  "query": "
query FocusProjectCandidateSearch($searchString: String!, $first: Int!, $after:String) {
    rateLimit{
        cost
        limit
        nodeCount
        remaining
        resetAt
        used
    }
    search(type:REPOSITORY, query:$searchString, first:$first, after:$after){
        pageInfo {
            startCursor
            hasNextPage
            endCursor
        }
        repositoryCount
        nodes{
            ...RepositorySummary
        }
    }
}
fragment RepositorySummary on Repository{
    nameWithOwner
    isInOrganization
    owner{
        login
    }
    forkCount
    stargazerCount
    pullRequests{
        totalCount
    }
    issues{
        totalCount
    }
    mentionableUsers{
        totalCount
    }
    watchers{
        totalCount
    }
    discussions{
        totalCount
    }    
    createdAt
    isPrivate
    pushedAt
    visibility
    primaryLanguage{
        name
    }
    languages(first:100){
        edges{
            size
            node{
              name
            }
        }
    }
}
",
  "variables": {
    "searchString": "is:public template:false archived:false stars:>=50 forks:>=50 size:>=1000 pushed:>=2023-11-21 created:2017-08-01..2017-08-05",
    "first": 100,
    "after": null
  }
}

